XMLDataInput.Script:
function validateElementName(String name) : String
   {
   if (name.isEmpty()) return "Empty";
   name.replace("@", "_at_");
   name.replace("$", "_Dollar_");
   name.replace(" ", "_");
   return name;
   }

File.JSONReader reader;
reader.initInputStream(getStream(),"UTF-8");
while(reader.read())
   {
   is(reader.NodeType)
      {
      File.JSONNodeType.ObjectBegin:
         elementBegin(validateElementName(reader.Key));

      File.JSONNodeType.ObjectEnd:
         elementEnd();
      
      File.JSONNodeType.Value:
         {
         elementBegin(validateElementName(reader.Key));
         unparsed(reader.Value);
         elementEnd();
         }
      }
   }

